import React from "react";
import './Gallery.css'
import img1 from './img1.jpeg'
import PhotoAlbum from "react-photo-album";

const photos = [
    { src: img1, width: 3024 , height: 4032 },
    { src: "/images/image2.jpg", width: 1600, height: 900 },
  ];

const Gallery = () => {
    return (
        <PhotoAlbum layout="rows" photos={photos} />
    );
}
export {Gallery}
